import axios from 'axios';

const API_BASE_URL = process.env.REACT_APP_API_URL || 'http://localhost:5000/api';

const api = axios.create({
  baseURL: API_BASE_URL,
  timeout: 30000,
  headers: {
    'Content-Type': 'application/json',
    'Accept': 'application/json',
    'Accept-Language': 'ar'
  }
});

// ==================== Interceptors ====================
api.interceptors.request.use(
  (config) => {
    const token = localStorage.getItem('token');
    
    if (token) {
      config.headers.Authorization = `Bearer ${token}`;
    }
    
    return config;
  },
  (error) => {
    return Promise.reject(error);
  }
);

api.interceptors.response.use(
  (response) => {
    return response.data;
  },
  (error) => {
    console.error('API Error:', error.response?.status, error.message);
    
    if (error.response?.status === 401) {
      localStorage.removeItem('token');
      localStorage.removeItem('user');
      window.location.href = '/login';
    }
    
    return Promise.reject(error);
  }
);

// ==================== API Methods ====================

// 1. Authentication
api.login = async (email, password) => {
  try {
    const response = await api.post('/auth/login', { email, password });
    
    if (response.success && response.token) {
      localStorage.setItem('token', response.token);
      localStorage.setItem('user', JSON.stringify(response.user));
    }
    
    return response;
  } catch (error) {
    return {
      success: false,
      message: error.response?.data?.message || 'تعذر الاتصال بالخادم'
    };
  }
};

api.logout = () => {
  localStorage.removeItem('token');
  localStorage.removeItem('user');
  window.location.href = '/login';
};

// 2. Shifts
api.startShift = async () => {
  try {
    const response = await api.post('/shifts/start');
    return response;
  } catch (error) {
    return {
      success: false,
      message: error.response?.data?.message || 'تعذر بدء الشيفت'
    };
  }
};

api.getActiveShift = async () => {
  try {
    const response = await api.get('/shifts/simple');
    return response;
  } catch (error) {
    return {
      success: false,
      message: 'تعذر جلب الشيفت النشط'
    };
  }
};

api.endShift = async (shiftId) => {
  try {
    const response = await api.put(`/shifts/${shiftId}/end`);
    return response;
  } catch (error) {
    return {
      success: false,
      message: 'تعذر إنهاء الشيفت'
    };
  }
};

// 3. Games
api.getGames = async (params = {}) => {
  try {
    const response = await api.get('/games', { params });
    return response;
  } catch (error) {
    return {
      success: false,
      message: 'تعذر تحميل الألعاب',
      data: []
    };
  }
};

// 4. Rentals
api.getActiveRentals = async () => {
  try {
    const response = await api.get('/rentals/active');
    return response;
  } catch (error) {
    return {
      success: false,
      message: 'تعذر تحميل التأجيرات النشطة',
      data: []
    };
  }
};

api.createRental = async (rentalData) => {
  try {
    const response = await api.post('/rentals/simple', rentalData);
    return response;
  } catch (error) {
    return {
      success: false,
      message: error.response?.data?.message || 'تعذر إنشاء التأجير'
    };
  }
};

api.completeRental = async (rentalId, paymentData = {}) => {
  try {
    const response = await api.post(`/rentals/${rentalId}/complete`, paymentData);
    return response;
  } catch (error) {
    return {
      success: false,
      message: 'تعذر إكمال التأجير'
    };
  }
};

api.cancelRental = async (rentalId) => {
  try {
    const response = await api.post(`/rentals/${rentalId}/cancel`);
    return response;
  } catch (error) {
    return {
      success: false,
      message: 'تعذر إلغاء التأجير'
    };
  }
};

// 5. Completed Rentals
api.getCompletedRentals = async (params = {}) => {
  try {
    const response = await api.get('/rentals', { params });
    return response;
  } catch (error) {
    return {
      success: false,
      message: 'تعذر تحميل التأجيرات المكتملة',
      data: []
    };
  }
};

// 6. Stats
api.getStats = async () => {
  try {
    const response = await api.get('/dashboard/stats/simple');
    return response;
  } catch (error) {
    return {
      success: false,
      message: 'تعذر تحميل الإحصائيات',
      data: {
        availableGames: 0,
        totalGames: 0,
        todayRevenue: 0,
        todayRentals: 0,
        activeRentals: 0
      }
    };
  }
};

// 7. Health Check
api.healthCheck = async () => {
  try {
    const response = await api.get('/health');
    return response;
  } catch (error) {
    return {
      success: false,
      message: 'تعذر الاتصال بالخادم'
    };
  }
};

export default api;
